import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom'
import Login from './pages/Login';
import Layout from './pages/Layout';

function App () {
    return (
        <Switch>
            <Route path='/login' component={Login} />
            <Route path='/index' component={Layout} />
            <Redirect to="/login" />
        </Switch>
    );
}

export default App;
